import { MoviesGrid } from "../components/movieGrid/MoviesGrid";
import { Search } from "../components/search/Search";

export function LandingPage({ data }) {
  return (
    <div>
      <Search data={data} />
      <MoviesGrid />
    </div>
  );
}
